import { Route, Routes} from "react-router-dom";
function AdminOrderInfo({ orders }) {
  return (
    <Routes>
      {orders&&orders.data.OrderFind.map((order) => {
        return (
          <Route
            path={order._id}
            element={<>hello</>}
            key={"route" + order._id}
          />
        );
      })}
    </Routes>
  );
}
export default AdminOrderInfo;
